var changes=[],observer=new MutationObserver(function(e){e.forEach(function(e){var t=new Date,r={mutation:e,datetime:t.getFullYear()+"-"+String("0"+t.getMonth()).slice(-2)+"-"+String("0"+t.getDate()).slice(-2)+" "+String("0"+t.getHours()).slice(-2)+":"+String("0"+t.getMinutes()).slice(-2)+":"+String("0"+t.getSeconds()).slice(-2)};changes.push(r)})});observer.observe(document.getElementById("board"),{characterDataOldValue:!0,attributeOldValue:!0,characterData:!0,attributes:!0,childList:!0,subtree:!0});